void GLPrimitive::box(float lx, float ly, float lz, Material *mat, Matrix4f *t){
	glPushMatrix(); 
	float transform[16]; 
	t->get(transform); 
	glMultMatrixf(transform); 
	//BOX
	//PARAM: lx : x length / ly : y length / lz : z length

	mat->gl();
	float lx_2 = lx/2, ly_2 = ly/2, lz_2 = lz/2;
	glBegin(GL_QUADS);
	glNormal3f(0,0,+1);
	glVertex3f(-lx_2,-ly_2,+lz_2);
	glVertex3f(+lx_2,-ly_2,+lz_2);
	glVertex3f(+lx_2,+ly_2,+lz_2);
	glVertex3f(-lx_2,+ly_2,+lz_2);
	glNormal3f(0,0,-1);
	glVertex3f(-lx_2,-ly_2,-lz_2);
	glVertex3f(-lx_2,+ly_2,-lz_2);
	glVertex3f(+lx_2,+ly_2,-lz_2);
	glVertex3f(+lx_2,-ly_2,-lz_2);
	glNormal3f(-1,0,0);
	glVertex3f(-lx_2,-ly_2,-lz_2);
	glVertex3f(-lx_2,-ly_2,+lz_2);
	glVertex3f(-lx_2,+ly_2,+lz_2);
	glVertex3f(-lx_2,+ly_2,-lz_2);
	glNormal3f(+1,0,0);
	glVertex3f(+lx_2,-ly_2,-lz_2);
	glVertex3f(+lx_2,+ly_2,-lz_2);
	glVertex3f(+lx_2,+ly_2,+lz_2);
	glVertex3f(+lx_2,-ly_2,+lz_2);
	glNormal3f(0,+1,0);
	glVertex3f(-lx_2,+ly_2,-lz_2);
	glVertex3f(-lx_2,+ly_2,+lz_2);
	glVertex3f(+lx_2,+ly_2,+lz_2);
	glVertex3f(+lx_2,+ly_2,-lz_2);
	glNormal3f(0,-1,0);
	glVertex3f(-lx_2,-ly_2,-lz_2);
	glVertex3f(+lx_2,-ly_2,-lz_2);
	glVertex3f(+lx_2,-ly_2,+lz_2);
	glVertex3f(-lx_2,-ly_2,+lz_2);
	glEnd();
	glPopMatrix(); 
}

